import axios from "axios"
const URL="https://api.openweathermap.org/data/2.5/weather"
const API_KEY="7471a6b39a47fe9afbe0339675ad5866"
const Backend=async (query)=>{
   let{data}= await axios.get(URL,{
        params:{
            q:query,
            APPID:API_KEY,
            units:"metric"
        }
    })
    return data
}  
export default Backend;
